DROP TABLE IF EXISTS salary;
CREATE TABLE salary(
   id                                 INTEGER  NOT NULL PRIMARY KEY 
  ,work_year                          INTEGER  NOT NULL
  ,expericence_level_id               INTEGER  NOT NULL
  ,employment_type_id                 INTEGER  NOT NULL
  ,job_title_id                       INTEGER  NOT NULL
  ,salary_in_usd                      INTEGER  NOT NULL
  ,employee_residence_country_code_id VARCHAR(4) NOT NULL
  ,remote_ratio                       INTEGER  NOT NULL
  ,company_location_country_code_id   VARCHAR(4) NOT NULL
  ,company_size                       VARCHAR(1) NOT NULL
);
